// SPDX-License-Identifier: MIT
pragma solidity 0.8.16;

contract SmartContractWallet{
    address payable public owner;

    mapping (address=> uint) public allowance;
    mapping (address=> bool) public isAllowedToSend;

    mapping (address => bool) public guardians;
    address payable nextOwner;
    mapping (address => mapping (address=> bool)) nextOwnerGuardianVotedBool;
    uint guardiansReserCount;
    uint public constant confirmationsFromGuardiansForReset = 3;
    constructor(){
        owner = payable (msg.sender);
    }

    function setGuardian(address _guardian, bool _isGuardian) public {
        require(msg.sender == owner, "you are not the owner");
        guardians[_guardian] = _isGuardian;
    }


    function proposeNewOwner(address  payable _newOwner) public {
        require(guardians[msg.sender], "you are not guardian of this wallet");
    require(nextOwnerGuardianVotedBool[_newOwner][msg.sender] == false, "You are already voted");
       if(_newOwner != nextOwner){
        nextOwner = _newOwner;
        guardiansReserCount = 0;
       }

       guardiansReserCount++;
       if(guardiansReserCount >= confirmationsFromGuardiansForReset){
        owner = nextOwner;
        nextOwner = payable (address(0));
       }
    }

    function setAllowance(address _for, uint _amount) public {
        require(msg.sender == owner, "you are not the owner, aborting!");

        allowance[_for] = _amount;

        if(_amount > 0){
            isAllowedToSend[_for] = true;
        }else {
            isAllowedToSend[_for] = false;
        }
    }
    function transfer(address payable _to, uint _amount, bytes memory _payload) public returns (bytes memory){
        require(msg.sender == owner, "You are not the owner, aborting!");

        if(msg.sender != owner){
            require(isAllowedToSend[msg.sender], "You are not allowed to send anything from this smart contract, Aborting!");
            require(allowance[msg.sender] >= _amount, "You are sending more than your allowance");

            allowance[msg.sender] -= _amount;
        }

        (bool success, bytes memory returnData) = _to.call{value: _amount}(_payload);

        require(success, "Aborting, call was not executed");
        return returnData;
    }

    receive() external payable { }
}

